import React from "react";
import styled from "styled-components";
const Wrapper = styled.section`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
  z-index: 500;
  & > .back {
    width: 100%;
    height: 100%;
    position: absolute;
    left: 0;
    top: 0;
    background-color: black;
    opacity: 0.5;
  }
  & > .box {
    position: relative;
    z-index: 2000;
    width: 341px;
    height: 421px;
    border-radius: 20px;
    background-color: white;
    & > figure {
      width: 145px;
      height: 145px;
      background-color: #f4f4f4;
      border-radius: 145px;
      display: flex;
      justify-content: center;
      align-items: center;
      & > img {
        width: 91.4px;
        height: 88.7px;
      }
    }
  }
`;
function Popup() {
  return (
    <Wrapper>
      <div className="back" />
      <div className="box">
        <figure className="profile">
          <img src="/assets/kimface.svg" alt="" />
        </figure>
        <div className="title">문의가 접수되었습니다</div>
        <div className="sub">
          내용이 확인되는대로 답변 드리겠습니다. <br /> 남겨주신 이메일로
          상세하게 <br />
          답변드리도록 하겠습니다.
        </div>
        <button>메인으로</button>
      </div>
    </Wrapper>
  );
}

export default Popup;
